/**
76. 最小覆盖子串
难度
困难
给你一个字符串 S、一个字符串 T 。请你设计一种算法，可以在 O(n) 的时间复杂度内，从字符串 S 里面找出：包含 T 所有字符的最小子串。
示例：
输入：S = "ADOBECODEBANC", T = "ABC"
输出："BANC"
提示：
如果 S 中不存这样的子串，则返回空字符串 ""。
如果 S 中存在这样的子串，我们保证它是唯一的答案。
通过次数75,202提交次数193,358
 * @param {string} s
 * @param {string} t
 * @return {string}
 */
var minWindow = function(s, t) {
    let missingMap = new Map(),freq,matched=0
    for(let i=0;i<t.length;i++){
        freq = missingMap.get(t[i])
        freq = freq==null?0:freq
        missingMap.set(t[i],freq+1)
    }
    let begin=-1,end=s.length
    let i=0,j=0,rightChar
    for(;j<s.length;j++){
        rightChar = s[j]
        freq = missingMap.get(rightChar)
        if(freq!=null){
            missingMap.set(rightChar,freq-1)
            if(freq>0)matched++
            if(matched==t.length){
                do{
                    freq = missingMap.get(s[i])
                    if(freq!=null){
                        missingMap.set(s[i],freq+1)
                        if(freq>=0)matched--
                    }
                    i++
                }while(matched==t.length)
                if(end-begin>j-i+1)end=j,begin=i-1
            }
        }
    }
    return begin<0?'':s.substring(begin,end+1)
};
let s = 'ADOBECODEBANC',t="ABC"
//s='abcdefaba', t = 'aa'
s = ""
t = ""
let begin = new Date().getTime()
console.info(minWindow(s,t))
let end = new Date().getTime()
console.info(end-begin)